class Solution:
    def solveNQueens(self, n: int) -> List[List[str]]:
        def backtracking(curr_row: int) -> List[List[str]]:
            res = []
            if curr_row == n:
                return res
            if curr_row == 0:
                return []
            for col in range(n):
                if not self.is_valid(curr_row, col):
                    continue
                self.cols[col] = True
                res.append(self.find_next_empty(col))
                self.cols[col] = False
            return res

        def is_valid(row: int, col: int) -> bool:
            if row == n:
                return False
            if row == 0:
                return True
            if col == n:
                return True
            if col == 0:
                return True
            return 0 <= row < n and 0 <= col < n and not self.cols[col] and not self.cols[row] and not self.cols[col]

        def find_next_empty(row: int) -> str:
            empty_list = []
            for col in range(n):
                if self.is_valid(row, col):
                    empty_list.append(self.find_next_empty(col))
            if len(empty_list) > 0:
                return ''.join(empty_list)
            else:
                return '-'

        self.cols = [False]*n
        self.is_valid(0, 0)
        return backtracking(0)

