        return sum(nums) == n

    def create_graph(nums: list[int], exclude: list[int]) -> defaultdict:
        graph = defaultdict(list)
        for a, b in combinations(nums, 2):
            graph[a].append(b)
            graph[b].append(a)
        return graph

    def dfs(nums: list[int], graph: defaultdict, to_visit: list[int], results: set[tuple[int, int]]):
        if not to_visit:
            if not to_visit:
                if not graph[nums]:
                    results.add((nums, 1))
                    return
            else:
                to_visit.append(nums)
                for a in graph[nums]:
                    if a not in to_visit:
                        dfs(a, graph, to_visit, results)

                to_visit.pop()
        else:
            for a, b in graph[nums]:
                if a not in to_visit:
                    results.add((a, 1))
                    dfs(a, graph, to_visit, results)
            to_visit.append(nums)

