            graph[nums] = []
            continue

        dfs(nums, graph, [], set())

    graph = defaultdict(list)
    for a, b in graph.items():
        graph[a].append(b)
        graph[b].append(a)

    for key, val in graph.items():
        if len(val) > 1:
            val = sorted(val, key=lambda x: (x[0], x[1]))
            val = sorted(val, key=lambda x: (x[0], -x[1]))
