    """
    "Using A* to solve the puzzle."
    https://leetcode.com/problems/triple-solution/discuss/671669/Python-3-using-A*-A*-solution-with-explanation
    """
    def solve(l: list):
        """
        Possible solutions
        For all i, j, k, we have l_i, l_j, l_k,
        that satisfy both:
        1. L_i and L_j are all different.
        2. L_i, l_j, and L_k are all different.
        3. L_i, l_j, and l_k are all different.
        4. L_i, l_j, and L_k are all different.
        5. l_i, l_j, and l_k are all different.
        """
        if len(l) == 3:
            return 1
        if len(l) == 4:
            return 2
        if len(l) == 5:
            return 3
        if len(l) == 6:
            return 4
        if len(l) == 7:
            return 5

        triple = []
        for i in range(1, len(l) + 1):
            for j in range(1, i + 1):
                for k in range(1, j + 1):
                    triple.append(str(l[i - 1] + l[j - 1] + l[k - 1]))

        if len(set(triple)) == 3:
            return solve(l[:len(l) // 2]) + solve(l[len(l) // 2:])
        else:
            return solve(l[:len(l) // 3]) + solve(l[len(l) // 3:])

    return solve(list(map(int, stdin.split())))

