class Solution:
    def findSubtree(self, root: TreeNode) -> int:


        # If we have only one node return it
        if root is None:
            return 0

        # Return the width of the subtree
        left = self.getHeight(root.left)
        right = self.getHeight(root.right)

        # If we have two nodes return
        # the max width of the left and right subtree
        if left == right:
            return 2 ** left

        # If we have two subtrees
        # return the max width of left and right subtree
        return 1 + max(left, right)

    def getHeight(self, root: TreeNode) -> int:
        if root is None:
            return 0
        else:
            return 1 + self.getHeight(root.left) + self.getHeight(root.right)

