        if op == "+":
            return A + B
        elif op == "-":
            return A - B
        else:
            raise ValueError("op should be + or -")

    def evalOp(self, A, B, op):
        return eval(op + str(A) + str(B))

    def evalFormula(self, A, B, op):
        return self.eval(A, B, op)

    def solution(self, stdin: str) -> str:
        A, B = map(int, stdin.split())
